                2 -> skip_length_delimited_heartbeat_request(Rest, 0, 0, Key bsr 3, F@_1, TrUserData);
                3 -> skip_group_heartbeat_request(Rest, 0, 0, Key bsr 3, F@_1, TrUserData);
                5 -> skip_32_heartbeat_request(Rest, 0, 0, Key bsr 3, F@_1, TrUserData)
            end
    end;
dg_read_field_def_heartbeat_request(<<>>, 0, 0, _, F@_1, _) ->
    S1 = #{},
    if F@_1 == '$undef' -> S1;
       true -> S1#{host => F@_1}
    end.

d_field_heartbeat_request_host(<<1:1, X:7, Rest/binary>>, N, Acc, F, F@_1, TrUserData) when N < 57 -> d_field_heartbeat_request_host(Rest, N + 7, X bsl N + Acc, F, F@_1, TrUserData);
d_field_heartbeat_request_host(<<0:1, X:7, Rest/binary>>, N, Acc, F, Prev, TrUserData) ->
    {NewFValue, RestF} = begin Len = X bsl N + Acc, <<Bs:Len/binary, Rest2/binary>> = Rest, {id(decode_msg_host(Bs, TrUserData), TrUserData), Rest2} end,
    dfp_read_field_def_heartbeat_request(RestF,
                                         0,
                                         0,
                                         F,
                                         if Prev == '$undef' -> NewFValue;
                                            true -> merge_msg_host(Prev, NewFValue, TrUserData)
                                         end,
                                         TrUserData).

skip_varint_heartbeat_request(<<1:1, _:7, Rest/binary>>, Z1, Z2, F, F@_1, TrUserData) -> skip_varint_heartbeat_request(Rest, Z1, Z2, F, F@_1, TrUserData);
