read_group(Bin, FieldNum) ->
    {NumBytes, EndTagLen} = read_gr_b(Bin, 0, 0, 0, 0, FieldNum),
    <<Group:NumBytes/binary, _:EndTagLen/binary, Rest/binary>> = Bin,
    {Group, Rest}.

%% Like skipping over fields, but record the total length,
%% Each field is <(FieldNum bsl 3) bor FieldType> ++ <FieldValue>
%% Record the length because varints may be non-optimally encoded.
%%
%% Groups can be nested, but assume the same FieldNum cannot be nested
%% because group field numbers are shared with the rest of the fields
%% numbers. Thus we can search just for an group-end with the same
%% field number.
%%
%% (The only time the same group field number could occur would
%% be in a nested sub message, but then it would be inside a
%% length-delimited entry, which we skip-read by length.)
read_gr_b(<<1:1, X:7, Tl/binary>>, N, Acc, NumBytes, TagLen, FieldNum)
  when N < (32-7) ->
    read_gr_b(Tl, N+7, X bsl N + Acc, NumBytes, TagLen+1, FieldNum);
read_gr_b(<<0:1, X:7, Tl/binary>>, N, Acc, NumBytes, TagLen,
          FieldNum) ->
    Key = X bsl N + Acc,
    TagLen1 = TagLen + 1,
    case {Key bsr 3, Key band 7} of
        {FieldNum, 4} -> % 4 = group_end
            {NumBytes, TagLen1};
        {_, 0} -> % 0 = varint
            read_gr_vi(Tl, 0, NumBytes + TagLen1, FieldNum);
        {_, 1} -> % 1 = bits64
            <<_:64, Tl2/binary>> = Tl,
            read_gr_b(Tl2, 0, 0, NumBytes + TagLen1 + 8, 0, FieldNum);
        {_, 2} -> % 2 = length_delimited
            read_gr_ld(Tl, 0, 0, NumBytes + TagLen1, FieldNum);
        {_, 3} -> % 3 = group_start
            read_gr_b(Tl, 0, 0, NumBytes + TagLen1, 0, FieldNum);
        {_, 4} -> % 4 = group_end
            read_gr_b(Tl, 0, 0, NumBytes + TagLen1, 0, FieldNum);
        {_, 5} -> % 5 = bits32
            <<_:32, Tl2/binary>> = Tl,
            read_gr_b(Tl2, 0, 0, NumBytes + TagLen1 + 4, 0, FieldNum)
    end.

read_gr_vi(<<1:1, _:7, Tl/binary>>, N, NumBytes, FieldNum)
  when N < (64-7) ->
    read_gr_vi(Tl, N+7, NumBytes+1, FieldNum);
read_gr_vi(<<0:1, _:7, Tl/binary>>, _, NumBytes, FieldNum) ->
    read_gr_b(Tl, 0, 0, NumBytes+1, 0, FieldNum).

read_gr_ld(<<1:1, X:7, Tl/binary>>, N, Acc, NumBytes, FieldNum)
  when N < (64-7) ->
    read_gr_ld(Tl, N+7, X bsl N + Acc, NumBytes+1, FieldNum);
read_gr_ld(<<0:1, X:7, Tl/binary>>, N, Acc, NumBytes, FieldNum) ->
    Len = X bsl N + Acc,
    NumBytes1 = NumBytes + 1,
    <<_:Len/binary, Tl2/binary>> = Tl,
    read_gr_b(Tl2, 0, 0, NumBytes1 + Len, 0, FieldNum).

merge_msgs(Prev, New, MsgName) when is_atom(MsgName) -> merge_msgs(Prev, New, MsgName, []).

merge_msgs(Prev, New, MsgName, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case MsgName of
        create_bootstrap_token_request -> merge_msg_create_bootstrap_token_request(Prev, New, TrUserData);
        create_bootstrap_token_response -> merge_msg_create_bootstrap_token_response(Prev, New, TrUserData);
        host -> merge_msg_host(Prev, New, TrUserData);
        list_hosts_request -> merge_msg_list_hosts_request(Prev, New, TrUserData);
        list_hosts_response -> merge_msg_list_hosts_response(Prev, New, TrUserData);
        register_host_request -> merge_msg_register_host_request(Prev, New, TrUserData);
        heartbeat_request -> merge_msg_heartbeat_request(Prev, New, TrUserData);
        heartbeat_response -> merge_msg_heartbeat_response(Prev, New, TrUserData);
        empty -> merge_msg_empty(Prev, New, TrUserData)
    end.

-compile({nowarn_unused_function,merge_msg_create_bootstrap_token_request/3}).
merge_msg_create_bootstrap_token_request(PMsg, NMsg, _) ->
    S1 = #{},
    case {PMsg, NMsg} of
        {_, #{expires_at := NFexpires_at}} -> S1#{expires_at => NFexpires_at};
        {#{expires_at := PFexpires_at}, _} -> S1#{expires_at => PFexpires_at};
        _ -> S1
    end.

-compile({nowarn_unused_function,merge_msg_create_bootstrap_token_response/3}).
merge_msg_create_bootstrap_token_response(PMsg, NMsg, _) ->
    S1 = #{},
    case {PMsg, NMsg} of
        {_, #{token := NFtoken}} -> S1#{token => NFtoken};
        {#{token := PFtoken}, _} -> S1#{token => PFtoken};
        _ -> S1
    end.

-compile({nowarn_unused_function,merge_msg_host/3}).
merge_msg_host(PMsg, NMsg, _) ->
    S1 = #{},
    S2 = case {PMsg, NMsg} of
             {_, #{name := NFname}} -> S1#{name => NFname};
             {#{name := PFname}, _} -> S1#{name => PFname};
             _ -> S1
         end,
    case {PMsg, NMsg} of
        {_, #{address := NFaddress}} -> S2#{address => NFaddress};
        {#{address := PFaddress}, _} -> S2#{address => PFaddress};
        _ -> S2
    end.

-compile({nowarn_unused_function,merge_msg_list_hosts_request/3}).
merge_msg_list_hosts_request(_Prev, New, _TrUserData) -> New.

-compile({nowarn_unused_function,merge_msg_list_hosts_response/3}).
merge_msg_list_hosts_response(PMsg, NMsg, TrUserData) ->
    S1 = #{},
    case {PMsg, NMsg} of
        {#{hosts := PFhosts}, #{hosts := NFhosts}} -> S1#{hosts => 'erlang_++'(PFhosts, NFhosts, TrUserData)};
        {_, #{hosts := NFhosts}} -> S1#{hosts => NFhosts};
        {#{hosts := PFhosts}, _} -> S1#{hosts => PFhosts};
        {_, _} -> S1
    end.

-compile({nowarn_unused_function,merge_msg_register_host_request/3}).
merge_msg_register_host_request(PMsg, NMsg, TrUserData) ->
    S1 = #{},
    S2 = case {PMsg, NMsg} of
             {#{host := PFhost}, #{host := NFhost}} -> S1#{host => merge_msg_host(PFhost, NFhost, TrUserData)};
             {_, #{host := NFhost}} -> S1#{host => NFhost};
             {#{host := PFhost}, _} -> S1#{host => PFhost};
             {_, _} -> S1
         end,
    case {PMsg, NMsg} of
        {_, #{token := NFtoken}} -> S2#{token => NFtoken};
        {#{token := PFtoken}, _} -> S2#{token => PFtoken};
        _ -> S2
    end.

-compile({nowarn_unused_function,merge_msg_heartbeat_request/3}).
merge_msg_heartbeat_request(PMsg, NMsg, TrUserData) ->
    S1 = #{},
    case {PMsg, NMsg} of
        {#{host := PFhost}, #{host := NFhost}} -> S1#{host => merge_msg_host(PFhost, NFhost, TrUserData)};
        {_, #{host := NFhost}} -> S1#{host => NFhost};
        {#{host := PFhost}, _} -> S1#{host => PFhost};
        {_, _} -> S1
    end.

-compile({nowarn_unused_function,merge_msg_heartbeat_response/3}).
merge_msg_heartbeat_response(_Prev, New, _TrUserData) -> New.

-compile({nowarn_unused_function,merge_msg_empty/3}).
merge_msg_empty(_Prev, New, _TrUserData) -> New.


verify_msg(Msg, MsgName) when is_atom(MsgName) -> verify_msg(Msg, MsgName, []).

verify_msg(Msg, MsgName, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case MsgName of
        create_bootstrap_token_request -> v_msg_create_bootstrap_token_request(Msg, [MsgName], TrUserData);
        create_bootstrap_token_response -> v_msg_create_bootstrap_token_response(Msg, [MsgName], TrUserData);
        host -> v_msg_host(Msg, [MsgName], TrUserData);
        list_hosts_request -> v_msg_list_hosts_request(Msg, [MsgName], TrUserData);
        list_hosts_response -> v_msg_list_hosts_response(Msg, [MsgName], TrUserData);
        register_host_request -> v_msg_register_host_request(Msg, [MsgName], TrUserData);
        heartbeat_request -> v_msg_heartbeat_request(Msg, [MsgName], TrUserData);
        heartbeat_response -> v_msg_heartbeat_response(Msg, [MsgName], TrUserData);
        empty -> v_msg_empty(Msg, [MsgName], TrUserData);
        _ -> mk_type_error(not_a_known_message, Msg, [])
    end.


-compile({nowarn_unused_function,v_msg_create_bootstrap_token_request/3}).
-dialyzer({nowarn_function,v_msg_create_bootstrap_token_request/3}).
v_msg_create_bootstrap_token_request(#{} = M, Path, TrUserData) ->
    case M of
        #{expires_at := F1} -> v_type_string(F1, [expires_at | Path], TrUserData);
        _ -> ok
    end,
    lists:foreach(fun (expires_at) -> ok;
                      (OtherKey) -> mk_type_error({extraneous_key, OtherKey}, M, Path)
                  end,
                  maps:keys(M)),
    ok;
v_msg_create_bootstrap_token_request(M, Path, _TrUserData) when is_map(M) -> mk_type_error({missing_fields, [] -- maps:keys(M), create_bootstrap_token_request}, M, Path);
v_msg_create_bootstrap_token_request(X, Path, _TrUserData) -> mk_type_error({expected_msg, create_bootstrap_token_request}, X, Path).

